      amount: 294.67,
      date: new Date(2021, 1, 25),
    },
    { id: "e2", title: "New TV", amount: 294.67, date: new Date(2021, 2, 28) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 7, 12),
    },
    {
      id: "e4",
      title: "New Desktop",
      amount: 294.67,
      date: new Date(2021, 2, 6),
    },
  ];

  return React.createElement(
    "div",
