  );

  return (
    <div>
      <h1>Prima applicazione con React!</h1>
      <div className="expense-item">
        <Expenses expense={expenses[0]} />
        <Expenses expense={expenses[1]} />
        <Expenses expense={expenses[2]} />
        <Expenses expense={expenses[3]} />
      </div>
    </div>
  );
}

export default App;
